package gcom.gui.atendimentopublico;import org.apache.struts.validator.ValidatorActionForm;public class GerarCertidaoNegativaClienteActionForm extends ValidatorActionForm {	private static final long serialVersionUID = 1L;	private String idCliente;	private String cpfCnpj;	private String nomeCliente;	private String responsavel;	public String getResponsavel() {		return responsavel;	}	public void setResponsavel(String responsavel) {		this.responsavel = responsavel;	}	public String getCpfCnpj() {		return cpfCnpj;	}	public void setCpfCnpj(String cpfCnpj) {		this.cpfCnpj = cpfCnpj;	}	public String getIdCliente() {		return idCliente;	}	public void setIdCliente(String idCliente) {		this.idCliente = idCliente;	}	public String getNomeCliente() {		return nomeCliente;	}	public void setNomeCliente(String nomeCliente) {		this.nomeCliente = nomeCliente;	}}